import React from "react";
import Services from "../Services/Services";
import PodCast from "../PodCast/PodCast";
import "./home.css";
import "../Services/services.css"
import '../PodCast/podcast.css'

const Home = () => {
  
  const renderServices = () => {
    return (
      <div >
        <Services />
      </div>
    );
  };

  
  const renderPodCast = () => {
    return (
      <div >
        <PodCast />
      </div>
    );
  };

  return (
    <div className="wrapper">
      <div className="cols cols0">
        <h1 className="text">
          <span className="multiText">ALTITUDE</span>
        </h1>
        <p className="text">
          <span className="multiText_2">FITNESS MANAGEMENT</span>
        </p>
        <div className="video-container">
          <video className="video" autoPlay loop muted>
            <source
              src="/Pictures/Gym Example Compressed mp4.mp4"
              type="video/mp4"
            />
          </video>
        </div>
      </div>

      {/* Call the renderServices function */}
      {renderServices()}

      {/* Call the renderPodCast function */}
      {renderPodCast()}
    </div>
  );
};

export default Home;
